import React from 'react';
import './ProductTable.scss'; 

function TableSaleDetail({ products }) {
  return (
    <table  className="product-table">
      <thead>
        <tr>
        <th>NÃºmero</th>

          <th>Nombre de producto</th>
          <th>Marca</th>
          <th>Cantidad</th>
          <th>Unidad</th>
          <th>Monto Unitario (S/.)</th>
          <th>Monto Parcial (S/.)</th>
        </tr>
      </thead>
      <tbody>
        {products.map((product, index) => (
          <tr key={index}>
            <td>{index+1}</td>
            <td>{product.producto.nombre||product.promocion.descripcion}</td>
            <td>{product.producto.marca.nombre||"Promocion"}</td>
            <td>{product.cantidad} 
            </td>
            <td>{product.producto.unidad.nombre || "Unidad"}</td>
            <td>{(product.producto.precioVenta).toFixed(2) ||(product.promocion.precio).toFixed(2) }</td>
            <td>{(product.cantidad * product.producto.precioVenta).toFixed(2) || (product.cantidad * product.promocion.precio).toFixed(2)}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default TableSaleDetail;
